import React from 'react';
import './Logo.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';


// Return logo view 
export default function REturnLogo() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => {
 return (
  <div className='view-logo-send-money'>
   <ViewText />
  </div>
 )
}
export const ScreenSmall = () => {
 return (
  <div className='view-logo-send-money-sm'>
   <ViewText />
  </div>
 )
};

export const ViewText = () => {

 React.useEffect(() => {
  TweenMax.from('.Anima', 1.2, { delay: 1.2, y: 30, opacity: 0, ease: Expo.easeInOut });
 }, []);

 return (
  <img src={'/img/logo.png'} alt={'logo view '} className='Anima' />
 )
};
